import React from 'react'

const StarRating = ({rating}) => {
    const imgs = [] 
    for(let i = 1; i <= 5; i++){
        if (i <= rating){
            imgs.push(<i class = "fas fa-start"> </i>)
        }
        else{
          imgs.push(<i class = "far fa-start"> </i>)
        }
    }
  return (
    <>
    {imgs}
    </>
  )
}

export default StarRating
